import React from 'react'
import { Card } from 'antd';
import Avatar from 'antd/lib/avatar/avatar';

function UserProfile() {
    return (
        <div>
            <Card.Meta
                avatar={<Avatar>US</Avatar>}
                tile="Useong-Lee"
            />
        </div>
    )
}

export default UserProfile
